import React from 'react'
import { Container, Nav } from 'react-bootstrap';

function Ecwids(props) {
    return (
        <div>
            <Container>
                <Nav.Link href="#home">Ecwids</Nav.Link>
            </Container>
        </div>
    )
}

export default Ecwids;
